import Vue from 'vue';
import Item from './Index-item.vue';
export default Vue.extend({
  components: { Item },
  data() {
    return {};
  },
  computed: {
    // 中英翻译词典
    dict(): { [key: string]: string } {
      return this.$store.state.dict;
    },
    // 应用列表
    list(): string[] {
      return this.$store.state.list;
    },
    //系统应用列表
    sys(): string[] {
      return this.list
        .filter(name => SysList.includes(name))
        .sort((a, b) => SysList.indexOf(a) - SysList.indexOf(b));
    },
    //软件应用列表
    app(): string[] {
      return this.list
        .filter(name => AppList.includes(name))
        .sort((a, b) => AppList.indexOf(a) - AppList.indexOf(b));
    },
  },
});

//排序
const SysList = ['dde'];
const AppList = [
  'dde-file-manager',
  'deepin-appstore',
  'deepin-system-monitor',
  'deepin-terminal',
  'deepin-movie',
  'deepin-music',
